      <p>
        Lorem ipsum, dolor sit amet consectetur adipisicing elit. Recusandae
        iure officiis voluptate atque culpa esse animi aspernatur vitae ea sint
        provident exercitationem, soluta ut distinctio doloribus excepturi,
        magnam nisi modi?
      </p>
    </section>
  );
};

export default ProductSummary;
